class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $modulo
     * @param Integer $k
     * @return Integer
     */
    function countInterestingSubarrays($nums, $modulo, $k) {
        $n = count($nums);
        $prefixSum = array_fill(0, $n + 1, 0);
        $modCount = array_fill(0, $modulo, 0);
        $modCount[0] = 1;
        $result = 0;

        for ($i = 0; $i < $n; $i++) {
            $prefixSum[$i + 1] = $prefixSum[$i] + ($nums[$i] % $modulo == $k ? 1 : 0);
            $mod = $prefixSum[$i + 1] % $modulo;
            if ($mod == $k) {
                $result += $modCount[$mod];
            }
            $modCount[$mod]++;
        }

        return $result;
    }
}
